package main

import (
	"fmt"
)

func validPalindrome_help(s string) bool {

	if len(s) == 1 {
		return true
	}

	half := len(s) / 2

	for ind, el := range s {

		if ind > half {
			break
		}

		el_end := rune(s[len(s)-ind-1])

		if el_end != el {
			return false
		}
	}

	return true

}

func validPalindrome(s string) bool {
	if len(s) == 1 {
		return true
	}
	half := len(s) / 2
	// fmt.Println("half = ", half)

	for ind, el := range s {

		if ind > half {
			break
		}

		el_end := rune(s[len(s)-ind-1])

		// fmt.Println("el = ", string(el))

		if el_end != el {
			// fmt.Println("_", s[ind+1:len(s)-ind])
			// fmt.Println("__", s[ind:len(s)-ind-1])
			return validPalindrome_help(s[ind+1:len(s)-ind]) || validPalindrome_help(s[ind:len(s)-ind-1])
		}
	}

	return true

}

func main() {
	s := "cbbbcg"
	// s := "aydmda"
	// s := "abc"
	fmt.Println(s)
	// s := ""
	fmt.Println(validPalindrome(s))
}
